import styled from "styled-components";

const Father = styled.div`
  display: fles;
`;

const Box = styled.div`
  background-color: ${props => props.bgColor};
  width: 100px;
  height: 100px;
`;

const Circle = styled(Box)`
  border-radius: 50px;
`

function App() {
  return (
    <Father>
      <Box bgColor="blue"/>
      <Box bgColor="teal"/>
      <Box bgColor="tomato" />
    </Father>
  );
}

export default App;
